import React from 'react';
import Checkrole from '../services/Checkrole';
import UseGetRoleFromJWT from '../services/DecryptRole';

const index = () => {
    if(Checkrole(UseGetRoleFromJWT) !== "ADMIN"){
        if(Checkrole(UseGetRoleFromJWT) === "EMPLOYEE"){
            window.location.href = "/employee";
        }
        else if(Checkrole(UseGetRoleFromJWT) === "USER"){
            window.location.href = "/user";
        }
        else{
            window.location.href = "/welcome";
        }
    }




    return (
        <div>
            <h1>Admin page hehehe</h1>
        </div>
    );
};

export default index;
